CREATE TABLE VehicleInformation(
   id INTEGER PRIMARY KEY AUTOINCREMENT,
   name VARCHAR(100) NOT NULL,
   color VARCHAR(100) NOT NULL,
   engine_volume DOUBLE,
   copmany VARCHAR(20) NOT NULL,
   country VARCHAR(20),
   engine_power DOUBLE,
   plaque VARCHAR(20) NOT NULL,
   function INTEGER NOT NULL,
   is_painted BOOLEAN,
   level VARCHAR(10),
   state_city VARCHAR(100),
   state_the_neighbourhood VARCHAR(100),
   year_construction INTEGER,
   is_installment BOOLEAN,
   accelleration DOUBLE,
   gearbox VARCHAR(20),
   fuel_type VARCHAR(20),
   veh_picture BLOB,
   user_id INTEGER NOT NULL,
   price INTEGER NOT NULL,
   type INTEGER NOT NULL,
   CONSTRAINT UK_plaque UNIQUE(plaque),
   CONSTRAINT FK_user_vehicles_info FOREIGN KEY(user_id)
   REFERENCES User(id)
   ON UPDATE CASCADE
   ON DELETE CASCADE
   );
